import { TextField } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

function Login() {
  return (
    <Box>
      <TextField label="Enter username" variant="standard" />
      <TextField label="Enter password" variant="standard" />
    </Box>
  );
}

export default Login;
